import React from 'react';
import Checkbox from './Checkbox'; // ./Checkbox.js 파일에서 가져오기

function App() {
    const handleCheckboxChange = (isChecked) => {
        console.log('체크 상태:', isChecked);
    };

    return (
        <div>
            <h1>체크박스 컴포넌트</h1>
            <Checkbox label="동의합니다" onChange={handleCheckboxChange} />
        </div>
    );
}

export default App;
